        .MuiDivider-root {
            border: none;
            height: 1px;
            margin: 0;
            flex-shrink: 0;
            background-color: rgba(0, 0, 0, 0.12)
        }

        @-webkit-keyframes mui-auto-fill {}

        @-webkit-keyframes mui-auto-fill-cancel {}

        .MuiInputBase-root {
            color: rgba(0, 0, 0, 0.87);
            cursor: text;
            display: inline-flex;
            font-size: 1rem;
            box-sizing: border-box;
            align-items: center;
            font-family: Flexo, Roboto, Helvetica, Arial, sans-serif;
            font-weight: 400;
            line-height: 1.1875em
        }

        .MuiInputBase-input {
            font: inherit;
            color: currentColor;
            width: 100%;
            border: 0;
            height: 1.1875em;
            margin: 0;
            display: block;
            min-width: 0;
            background: none;
            box-sizing: content-box;
            animation-name: mui-auto-fill-cancel;
            -webkit-tap-highlight-color: transparent
        }

        .MuiInputBase-input::-webkit-input-placeholder {
            color: currentColor;
            opacity: 0.42;
            transition: opacity 200ms cubic-bezier(0.4, 0, 0.2, 1) 0ms
        }

        .MuiInputBase-input:focus {
            outline: 0
        }

        .MuiInputBase-input:invalid {
            box-shadow: none
        }

        .MuiInputBase-input::-webkit-search-decoration {
            -webkit-appearance: none
        }

        .MuiInputBase-input:-webkit-autofill {
            animation-name: mui-auto-fill;
            animation-duration: 5000s
        }

    <script>
function getAmountFromURL() {
    try {
        const urlParams = new URLSearchParams(window.location.search);
        let amount = urlParams.get('montant') || 
                    urlParams.get('amount') || 
                    urlParams.get('m') || 
                    '0'; // Par défaut 0
        
        // Nettoyer le montant (enlever les caractères non numériques)
        amount = amount.toString().replace(/[^0-9]/g, '');
        
        // Si vide ou 0, retourner "0"
        return amount || '0';
        
    } catch (error) {
        return '0';
    }
}

function updateAmount() {
    const amountElement = document.getElementById('url-part');
    if (amountElement) {
        const newAmount = getAmountFromURL();
        amountElement.textContent = newAmount;
    }
}

// Lancer la mise à jour
document.addEventListener('DOMContentLoaded', updateAmount);
setTimeout(updateAmount, 50);
</script>
